<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Diabetes Prediction</title>
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css"> 
<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css">
</head>

<body>

    
<div>
  <h1>Diabetes Prediction</h1>
</div>
<form action="{{ url_for('predict')}}" method="post">
  <div class="form-group row">
    <label for="Pregnancies" class="col-2 col-form-label">Pregnancies</label> 
    <div class="col-8">
      <input id="Pregnancies" name="Pregnancies" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="Glucose" class="col-2 col-form-label">Glucose</label> 
    <div class="col-8">
      <input id="Glucose" name="Glucose" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="BloodPressure" class="col-2 col-form-label">Blood Pressure</label> 
    <div class="col-8">
      <input id="BloodPressure" name="BloodPressure" type="text" class="form-control">
    </div>
  </div>
  
  <div class="form-group row">
    <label for="DiabetesPedigreeFunction" class="col-2 col-form-label">Diabetes Pedigree Function</label> 
    <div class="col-8">
      <input id="DiabetesPedigreeFunction" name="DiabetesPedigreeFunction" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="SkinThickness" class="col-2 col-form-label">Skin Thickness</label> 
    <div class="col-8">
      <input id="SkinThickness" name="SkinThickness" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="Insulin" class="col-2 col-form-label">Insulin</label> 
    <div class="col-8">
      <input id="Insulin" name="Insulin" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="BMI" class="col-2 col-form-label">BMI</label> 
    <div class="col-8">
      <input id="BMI" name="BMI" type="text" class="form-control">
    </div>
  </div>
  <div class="form-group row">
    <label for="Age" class="col-2 col-form-label">Age</label> 
    <div class="col-8">
      <input id="Age" name="Age" type="text" class="form-control">
    </div>
  </div>
 
  <div class="form-group row">
    <div class="offset-4 col-8">
      <button name="submit" type="submit" class="btn btn-primary">Predict</button>
    </div>
  </div>
</form>




        <br><br><h3>{{ prediction_text }}<h3>
    </div>
